		var ret = []
		for (let i = 0; i < GetShipmentTransactions.data.data.getInventoryTransactionsRaw.length; i++) {
			if (GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].materialSubLot != null) {
				let line = {
					"Material": GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].material.code,
					"Quantity": GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].quantity *-1,
					"TransactionId": GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].transactionId,
					"Serial Number": GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].materialSubLot.code
				}
				ret.push(line)
			} else {
				let line = {
					"Material": GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].material.code,
					"Quantity": GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].quantity *-1,
					"TransactionId": GetShipmentTransactions.data.data.getInventoryTransactionsRaw[i].transactionId,
					"Serial Number": ""
				}
				ret.push(line)
			}
		}
		return ret
	}

